def find_Max_Num(digits):
    from functools import cmp_to_key

    def compare(x, y):
        if x + y > y + x:
            return -1
        elif x + y < y + x:
            return 1
        else:
            return 0

    str_digits = [str(d) for d in digits]
    str_digits.sort(key=cmp_to_key(compare))

    return int(''.join(str_digits))

