        if num <= 1:
            return 0
        divisors_sum = 1
        for i in range(2, int(num**0.5) + 1):
            if num % i == 0:
                divisors_sum += i
                if i != num // i:
                    divisors_sum += num // i
        return divisors_sum

    amicable_numbers = set()

    for i in range(1, n):
        if i in amicable_numbers:
            continue

        sum_i = sum_of_proper_divisors(i)
        sum_sum_i = sum_of_proper_divisors(sum_i)

        if sum_sum_i == i and sum_i != i:
            amicable_numbers.add(i)
            if sum_i < n:
                amicable_numbers.add(sum_i)

    return sum(amicable_numbers)

