    n = len(arr)
    if n == 0:
        return 0
    if n == 1:
        return arr[0]

    inc = [0] * n
    dec = [0] * n

    inc[0] = arr[0]
    for i in range(1, n):
        inc[i] = arr[i]
        for j in range(i):
            if arr[j] < arr[i]:
                inc[i] = max(inc[i], inc[j] + arr[i])

    dec[n-1] = arr[n-1]
    for i in range(n-2, -1, -1):
        dec[i] = arr[i]
        for j in range(i+1, n):
            if arr[j] < arr[i]:
                dec[i] = max(dec[i], dec[j] + arr[i])

    max_bitonic = 0
    for i in range(n):
        max_bitonic = max(max_bitonic, inc[i] + dec[i] - arr[i])

    return max_bitonic

