def even_binomial_Coeff_Sum(n):
    def binomial_coeff(n, k):
        if k > n or k < 0:
            return 0
        if k == 0 or k == n:
            return 1

        result = 1
        for i in range(min(k, n - k)):
            result = result * (n - i) // (i + 1)
        return result

    total = 0
    for k in range(0, n + 1, 2):
        total += binomial_coeff(n, k)
    return total

